import React, { Component } from 'react'
import { auth } from './base'

class Admin extends Component{
     constructor(props){
          super(props)
          this.state = {
               isAuthing: true,
               isLoggedIn: false,
               user: null
          }
     }
     componentDidMount(){
          auth.onAuthStateChanged(user =>{
               console.log('auth',user)
          })
     }
     render(){
          return <h1>Admin</h1>
     }
}

export default Admin
